&quot;모든 짐승들은 밤에 활동한다. 저런 쓰레기를 씻어낼 진짜 비가 언젠가는 내려 다 쓸어버릴 것이다.&quot;

영화 택시드라이버 
 ㅡ트래비스의 독백중에서ㅡ

상쾌, 통쾌.
대사빨 죽이네.
&quot;몇명이냐?&quot; &quot;내가 이새끼 보내 버리면 몇명 남냐고?&quot;

와 오늘 개미쳤다 의겸이 미쳤다 개멋있엌ㅋㅋㅋㅋㅋ
&#x27;고맙다 남승식. 싸움 걸어줘서&#x27;
&#x27;내심 시비 안걸면 어쩌나 조바심 났었어&#x27;

와 대사 지려버리겠네

작가님 저런 암바는 없습니다ㅎㅎ;;;;
팔이 저렇게 잡히게 되면 오모플라타 라는 기술로 넘어가죠.
재미있게 잘 보고 있습니다.

